const router=createBrowserRouter([
    {
        path:"/",
        element:<App />,
        children:[
            {
                path:"",
                element:<Home />
            },
            {
                path:"*",
                element:<Error />
            },
            {
                path:"signin",
                element:<SignIn />
            },
            {
                path:"signup",
                
            }
        ]
    }
])

export default router
